import React from "react";
import Input from "../UI/Input";
import Button from "../UI/Button";
import styles from "./MealForm.module.css";

const MealForm = () => {
  return (
    <form className={styles.form}>
      <Input
        label="Enter amount"
        input={{
          id: "f1",
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
        }}
      />
      <Button label="Add +" type="primary" />
    </form>
  );
};

export default MealForm;
